import axios from "axios";
import { ref } from "vue";
import { Auth } from "@/store/auth";

export default function backend(url) {
  const apiUrl = 'http://localhost:8000/api/';
  const apiData = ref();

  const apiCall = () => {
    const returningData = ref();

    axios.get(apiUrl+"calendar/week", {
      headers: {
        'Authorization': 'Bearer '+ localStorage.getItem('token')
      }
    })
      .then(res => res.data).then(resJson => {
      returningData.value = resJson;
    });

    console.log(returningData.value);
    return returningData.value;
  }

  try {
    apiData.value = apiCall();
  } catch (e) {
    throw e;
  }

  return {
    apiData
  }
}
